import React, { Component } from "react";



class Person extends Component {
    state = {  }
    render() { 
        return ( 
                <form>
                    <label htmlFor="">Address</label>
                    <input type="text"/>
                    <br/>
                    <label htmlFor="">Email</label>
                    <input type="text"/>
                    <br/>
                </form>
            );
    }
}
 
export default Person;
